
_Key_Port_Init:

;libs/keypad.mbas,62 :: 		sub procedure Key_Port_Init()
;libs/keypad.mbas,66 :: 		DDD2_bit =0 DDD3_bit =0     DDD4_bit =0  ' configure PORTD as output
	IN         R27, DDD2_bit+0
	CBR        R27, BitMask(DDD2_bit+0)
	OUT        DDD2_bit+0, R27
	IN         R27, DDD3_bit+0
	CBR        R27, BitMask(DDD3_bit+0)
	OUT        DDD3_bit+0, R27
	IN         R27, DDD4_bit+0
	CBR        R27, BitMask(DDD4_bit+0)
	OUT        DDD4_bit+0, R27
;libs/keypad.mbas,67 :: 		DDD5_bit =0 DDD6_bit =0     DDD7_bit =0
	IN         R27, DDD5_bit+0
	CBR        R27, BitMask(DDD5_bit+0)
	OUT        DDD5_bit+0, R27
	IN         R27, DDD6_bit+0
	CBR        R27, BitMask(DDD6_bit+0)
	OUT        DDD6_bit+0, R27
	IN         R27, DDD7_bit+0
	CBR        R27, BitMask(DDD7_bit+0)
	OUT        DDD7_bit+0, R27
;libs/keypad.mbas,68 :: 		DDE6_bit = 0                    ' Set PORTE pin 7 as input pin for the Heater switches
	IN         R27, DDE6_bit+0
	CBR        R27, BitMask(DDE6_bit+0)
	OUT        DDE6_bit+0, R27
;libs/keypad.mbas,77 :: 		end sub
L_end_Key_Port_Init:
	RET
; end of _Key_Port_Init

